b'Jorginho on #Chelsea's clash with Juventus:

"They are getting back on track. Reuniting with their Azzurri will be extra exciting. We shared an extraordinary adventure that changed our careers and lives."

@Gazzetta_it'

b'Jorginho on Chelsea's clash with Juventus:

"Juventus are a great team with a rich history. It will be a special night because it will be the first match against an Italian team since joining Chelsea."

@Gazzetta_it'

